(198, 'microsoft', 3, 'CCD262DA-6CF3-40AE-A722-1F56441137F0', 'Dynamics 365 Layout', 'This subscription enables businesses to use Dynamics 365 Layout and its companion import tool to bring physical designs from concept to completion with confidence. Import 3D models to experience room layouts as holograms in the physical world or in virtual reality. Easily edit layouts in real-world scale, so you can make better decisions before you build. Additional hardware and software requirements vary for available features and content. To enable user access to this subscription, IT administrators must assign individual seats to users after purchase before users can install the app from the Microsoft Store or Store for Business. Subscription to this offer includes access to the Dynamics 365 Layout application and its companion app, Microsoft Dynamics 365 Import Tool (Preview).', '/76976bed-91f8-5eb1-a4d1-b4cfa57d3b63/Offers/CCD262DA-6CF3-40AE-A722-1F56441137F0', 1, 10000000, 0, '1', NULL, 'en-US', 'ES', false, false, true, 'license', 'seat', 'purchase', '[]', 'Enterprise', NULL, '[\"annual\",\"monthly\"]', '[]', '[]', '[]', '2020-04-10 12:21:58', '2020-04-13 18:01:02'),
