(535, 'microsoft', 3, 'BEC91CBF-3677-41E3-AFB8-BF98DB7B9BD4', 'Windows 10 Enterprise A3 for faculty', 'Windows 10 Enterprise provides enterprise-grade manageability and security for schools. The increased security helps protect your sensitive data, identities, and devices from cybersecurity threats, and provides enhanced deployment, software and device management options. \r\n\r\nCustomers purchasing Windows 10 Enterprise A3 get rights to use either Windows 10 Education or Windows 10 Enterprise editions. For digital subscription licenses, customers will only receive Windows 10 Enterprise. When using Windows 10 Enterprise edition in an education setting, devices should be configured with SetEduPolicies enabled. For more information please visit: https://docs.microsoft.com/education/windows/configure-windows-for-education\r\n', '/d558186c-3be8-46a3-b761-ad5cdebe129c/Offers/BEC91CBF-3677-41E3-AFB8-BF98DB7B9BD4', 1, 10000000, 2, '1', NULL, 'en-US', 'ES', false, false, true, 'license', 'seat', 'purchase', '[]', 'Education', NULL, '[\"annual\",\"monthly\"]', '[]', '[\"Education\"]', '[]', '2020-04-10 12:21:59', '2020-04-13 18:01:04'),
