(538, 'microsoft', 3, 'EAF7DB4C-B6AF-403D-A865-EA289B4FA306', 'Windows 10 Enterprise A5 for faculty', 'Windows 10 Enterprise A5 includes Windows 10 Enterprise plus Microsoft Defender Advanced Threat Protection (ATP). Microsoft Defender ATP enables enterprise customers to detect, investigate, and respond to advanced attacks and zero-days on their networksfor up to six months, in a single timeline. It is built-in, cloud powered, and leverages the Microsoft Intelligence Security Graph to integrate detection and exploration with Office 365 ATP*. *some separate subscriptions may be required.   \r\n\r\nCustomers purchasing Windows 10 Enterprise A5 get rights to use either Windows 10 Education or Windows 10 Enterprise editions. For digital subscription licenses, customers will only receive Windows 10 Enterprise. When using Windows 10 Enterprise edition in an education setting, devices should be configured with SetEduPolicies enabled. For more information please visit: https://docs.microsoft.com/education/windows/configure-windows-for-education', '/d558186c-3be8-46a3-b761-ad5cdebe129c/Offers/EAF7DB4C-B6AF-403D-A865-EA289B4FA306', 1, 10000000, 2, '1', NULL, 'en-US', 'ES', false, false, true, 'license', 'seat', 'purchase', '[]', 'Education', NULL, '[\"annual\",\"monthly\"]', '[]', '[\"Education\"]', '[]', '2020-04-10 12:21:59', '2020-04-13 18:01:04'),
(539, 'microsoft', 3, '4CF9EA2F-7E2E-43FC-8513-190127FC3573', 'Windows 10 Enterprise A5 for student use benefits', 'Customers qualifying Windows 10 Enterprise A5 Student Use Benefit get rights to install locally and use either Windows 10 Education or Windows 10 Enterprise editions. For digital subscription licenses, customers will only receive Windows 10 Enterprise. Windows 10 Enterprise provides enterprise-grade manageability and security for schools. The increased security helps protect your sensitive data, identities, and devices from cybersecurity threats, and provides enhanced deployment, software and device management options. When using Windows 10 Enterprise edition in an education setting, devices should be configured with SetEduPolicies enabled. For more information please visit: https://docs.microsoft.com/education/windows/configure-windows-for-education', '/d558186c-3be8-46a3-b761-ad5cdebe129c/Offers/4CF9EA2F-7E2E-43FC-8513-190127FC3573', 1, 10000000, 2, '1', NULL, 'en-US', 'ES', false, false, true, 'license', 'seat', 'purchase', '[]', 'Education', NULL, '[\"annual\",\"monthly\"]', '[]', '[\"Education\"]', '[]', '2020-04-10 12:21:59', '2020-04-13 18:01:04'),
