(541, 'microsoft', 3, '39504991-553B-48C2-BDF4-EA47F93BF784', 'Windows 10 Enterprise E3', 'Windows 10 Enterprise E3 builds on Windows 10 Pro by delivering enterprise-grade security, management, and control features for large or mid-sized companies, or any size business that processes sensitive data, operates in regulated industries, or develops intellectual property that must remain secured. The increased security helps protect your sensitive data, identities, and devices from cybersecurity threats, and provides enhanced deployment and software and device management options.', '/d558186c-3be8-46a3-b761-ad5cdebe129c/Offers/39504991-553B-48C2-BDF4-EA47F93BF784', 1, 10000000, 2, '1', NULL, 'en-US', 'ES', false, false, true, 'license', 'seat', 'purchase', '[]', 'Enterprise', NULL, '[\"annual\",\"monthly\"]', '[]', '[]', '[]', '2020-04-10 12:21:59', '2020-04-13 18:01:04'),
